pragma solidity >=0.4.22 <0.9.0;
pragma experimental ABIEncoderV2;

contract StorageIpfs{

    struct Ipfs{
          address userAddress;
          string ipfsHash;
          uint index;
          bool isValid;

    }

    string[]  private hashSet;  
    mapping(address => string) addressToHash;
    mapping(string =>address)  hashToAddress;
    mapping(string =>Ipfs)  hashToStruct;

    event StorageE(address ad,string ipfs); 

    function storeHashToAddress(address addr,string memory ipfsHash) public{

        addressToHash[addr] =ipfsHash;
        hashToAddress[ipfsHash]=addr;
        emit StorageE(addr, ipfsHash);
    }

     function getAddressByHash(string memory newhash)public view returns(address){
       return hashToAddress[newhash];
     }

